import React from 'react'
import { Navbar } from '../components/Navbar'
import { Box, Button, Container } from '@mui/material'

export default function sepetim() {
  return (
    <div>
      <Navbar/>
      <Container 
      marginTop={50}
       mt={10}
       component="span" style={{ marginTop:100, border: '1px ' }}>
      <Button>Save</Button>
    </Container>
    </div>
  )
}
